import React from 'react';

const VideoItem = ({ title, image }) => {
   return (
      <div className="item">
         <div>
            <img src={image} />
         </div>
         <div className="content">
            <p className="header">{title}</p>
         </div>
      </div>
   );
}

export default VideoItem;
